import React from 'react'
import {Navbar } from 'react-bootstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faExclamationCircle } from '@fortawesome/free-solid-svg-icons'

export const TopNav = () => {
    return (
      <Navbar className='components_topnav'>
        <FontAwesomeIcon icon="fa-solid fa-message-middle" />
        <FontAwesomeIcon icon={faExclamationCircle} style={{color:"whited"}}/> Hablemos.
      </Navbar>
    )
}
